package ManishLokesh.Neptune.v1.PNRService.PnrResponse;public class StationResponse {    private String code;    private String name;    private String delayArrival;    private String halt;    private String arrival;    private String departure;    private String depDate;    private boolean isServiceable;    @Override    public String toString() {        return "StationResponse{" +                "code='" + code + '\'' +                ", name='" + name + '\'' +                ", delayArrival='" + delayArrival + '\'' +                ", halt='" + halt + '\'' +                ", arrival='" + arrival + '\'' +                ", departure='" + departure + '\'' +                ", depDate='" + depDate + '\'' +                ", isServiceable=" + isServiceable +                '}';    }    public boolean isServiceable() {        return isServiceable;    }    public void setServiceable(boolean serviceable) {        isServiceable = serviceable;    }    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getDelayArrival() {        return delayArrival;    }    public void setDelayArrival(String delayArrival) {        this.delayArrival = delayArrival;    }    public String getHalt() {        return halt;    }    public void setHalt(String halt) {        this.halt = halt;    }    public String getArrival() {        return arrival;    }    public void setArrival(String arrival) {        this.arrival = arrival;    }    public String getDeparture() {        return departure;    }    public void setDeparture(String departure) {        this.departure = departure;    }    public String getDepDate() {        return depDate;    }    public void setDepDate(String depDate) {        this.depDate = depDate;    }}